import React, {useState} from "react";
// import logo from './logo.svg';
import "./styles/style.css";

// import Header from "./components/Header/Header"
// import ItemList from "./components/Room/ItemList"
// import ProjectList from "./components/Room/ProjectList"
// import KaneLogo from "./components/KaneLogo/KaneLogo"
import MainPage from "./components/Room/MainPage"

function Todo({todo, index}) {
  return(
    <div className="todo">
      {todo.text}
    </div>
  )

}

function App() { 
    const [todos, setTodos] = useState([
    {
      text: "My first todo item",
      isCompleted: false
    },
    {
      text: "merge cat food areas",
      isCompleted: false
    },
    {
      text: "clean carpet in bedroom",
      isCompleted: false
    }
  ]);

  return (
    <div className="app">
      <div className="todo-list">
        {todos.map((todo, index) => {
          <Todo key={index} index={index} todo={todo}/>
        })}
      </div>
    </div>
  )
}

export default App;





